// Makes the assumption that negotiation should be complete within 24 hours of receiving the order
long ms_threshold = 86400000;

def order_placed_ts = doc['load.timestamps.order_placed'].value.getMillis();
def current_time_ts = Instant.ofEpochMilli(new Date().getTime()).toEpochMilli();

// If negotiation hasn't been completed yet
if (doc["load.timestamps.negotiation_complete"].size() != 0) {
    def negotiation_complete_ts = doc['load.timestamps.negotiation_complete'].value.getMillis();

    // Determines if the negotiation was completed within 24h of receiving the order
    if (negotiation_complete_ts - order_placed_ts > ms_threshold) {
        emit("No")
    }
    // Timestamp exists, and it was completed on time
    else {
        emit("Yes")
    }
}
// If there is no negotiation timestamp
else {
    // Check to see if the current time is greater than 1 day past the order's creation time
    if (current_time_ts - order_placed_ts > ms_threshold) {
        emit("No")
    }
    else {
        emit("Pending")
    }
}        "}},"load.compliance.driver_assigned_on_time":{"type":"keyword","script":{"source":"
